import React from "react";
import "./style.css";

function Footer() {
    return (
        <footer className = "page-footer">
		<div className = "container-fluid text-center">
			<p className="footerWord"> App by Dane Shrewsbury </p>
		</div>	
	</footer>
    )
}




export default Footer;
